export default class extends XOElement {
    static attributes = {
        btn: String,
        icon: String,
        color: String,
        width: String,
        height: String,
        change(n, v) {
            switch (n) {
                case "btn":
                    if (this.matches("[btn]"))
                        this.$.container.href = "";
                    else
                        this.$.container.removeAttribute("href");
                    break;
                case "icon":
                    if (v === "") {
                        this.$.icon.innerHTML = "";
                        this.$.icon.style.setProperty("background", "#1d1d1d");
                        break;
                    }
                    this.$.icon.innerHTML = ICONS[v]["svg"];
                    this.$.icon.attributes.viewBox.value = ICONS[v]["view"];
                    break;
                case "color":
                    this.$.icon.style.setProperty("fill", v);
                    break;
                case "width":
                    this.$.container.style.setProperty("width", parseFloat(v) + "px");
                    break;
                case "height":
                    this.$.container.style.setProperty("height", parseFloat(v) + "px");
                    break;
            }
        }
    }

    static styles = `
        /* Globals */
        * {
            font-family: Arial, sans-serif;
            box-sizing: border-box;
        }
        /* Element */
        :host {
            box-sizing: content-box !important;
            display: inline-flex;
        }
        /* Container */
        #xo-container {
            display: flex;
            width: 34px;
            height: 34px;
        }
        /* Icon */
        #xo-icon {
            fill: #1d1d1d;
            width: 100%;
            height: 100%;
        }
        /* Variables */
            /* Container */
            #xo-container {
                {{--xo-container}}
            }
            #xo-container:hover {
                {{--xo-container-hover}}
            }
            /* Icon */
            #xo-icon {
                {{--xo-icon}}
            }
            #xo-icon:hover {
                {{--xo-icon-hover}}
            }
    `;

    render() {
        return /*html*/ `
            <a onclick="event.preventDefault()" id="xo-container">
                <svg id="xo-icon" version="1.0" viewBox="0 0 1000.000000 1000.000000" xmlns="http://www.w3.org/2000/svg" preserveAspectRatio="xMidYMid meet"></svg>
            </a>
        `;
    }
}